你，下次碰到我会和你正式的决斗，你最好投降。（骑士队长逃走了）","    你怎会击败我所有的手下？我和你誓不两立我决不认输。（骑士队长失去了理智）","    哼，你们这战怎么打得？骑士们给我冲！","    真正的战斗才刚开始，让我们继续，双手剑士给我上！","    哼，没关系，士兵们给我上！","    我还在担心你不能来了。我确信这次我一定能杀了你。鬼战士给我上！","    这魔塔太危险了，我可不想再次被抓，我要离塔回去了，再见。","    我听说骑士队长（本区的头目）实力差又爱吹牛，所以被魔法警卫们讨厌。","    你好，暗道已挖好，你可用它绕过魔龙。","    谜题：\u201c在3点，拥有传送功能的密宝 就会出现。\u201d","    塔内有个 幸运金币。拥有它在打败敌人后能获得2倍的金钱。","    存放圣剑的房间的门坏了，你必须用镐破墙而入。","    你需要用 地震卷轴 取出37楼仓库内的所有宝物。","    如果你能用好4种移动宝物，你不用与强敌作战就能上楼。","    别匆忙，放慢速度。","你以为你已非常强大了吗？嘿嘿错了，只是我今天状态不佳而已。我走了，有本事到40楼与我再打一次。","    你打败了前两个区域的头目，这表明你是个勇士。但现在游戏结束了，我将在这里亲手杀死你！","    魔塔有50层高,但似乎你不能直接到50楼。","    双手剑士的攻击力太高了，你最好到能对他一击必杀时再与他战斗。","    哈哈, 我们又见面了! 谢谢你救了我。我可以帮你在魔龙前打开一条暗道，我现在就去35楼。","    哦, 我刚完成暗道。你每次都及时赶到，看在朋友的份上，你可以免费使用。好了下次见。","    你先到别的地方走走，我还在挖暗道。","    如果你到27楼时状态为：生命1500，攻击80，防御98，拥有1兰钥匙，5黄钥匙。那么祝贺你，你前期是比较成功的。","    我没有什么可说的，但有一个确切的消息藏在这个楼层里。(我没有搞清楚此层在原游戏里的作用，现不找到所有的暗墙29楼暗道不开)","    大法师住在25楼，他是魔塔的主人。以你现在的状态去攻击他简直就是自杀。 你应当在取得更高级别的道具后再去打败他。","    上帝阿!我做梦也没想到我会被别人打败。毫无疑问你是比我强。但以你现在的状态对于大法师来说又太弱了，你仅仅取得了一个暂时的胜利。","    很好, 你打败了骷髅族，但别想象藐视骷髅人那样藐视我。我对于你就象是神一样，是不可战胜的。呵呵, 来吧!","    在这区域不多次提升攻击力，就不能打败 石头人。切记前人教训！","    我听说在塔内有2把隐藏的红钥匙。","    阿哈! 你还好吗? 这大章鱼挡住了我前进的道路，现在暗道终于完工了,你现在最好也躲开它。我要走了，再见。","    如果你持有十字架，面对兽人和吸血鬼时你的攻击力加倍。在没有十字架的情况下你不可能打败吸血鬼。十字架被藏在高于15楼的墙内。","    你是否注意到 5,9,14,16,18 楼有的墙与众不同？","    在商店里你最好选择提升防御，只有在攻击力低于敌人的防御力时才提升攻击力","    魔塔一共50层，每10层为一个区域。如果不打败此区域的头目就不能到更高的地方。","    你购买了礼物后再与商人对话，他会告诉你一些重要的消息。","    有些门不能用钥匙打开，只有当你打败它的守卫后才会自动打开。","    不,这是不可能的， 你怎会打败我！ 你别太得意，后面还有许多强大的对手和机关存在，你稍有疏忽就必死无疑。","    你怎能杀出重围？我是决不会让你通过的，来吧，我要与你决斗!","    哈哈哈, 你是如此的幸运能安全到达这里。 但现在好运离你而去了，你中埋伏了，弟兄们给我上。","    嘿！我们又见面了！非常感谢你打败了此区域的头目。我正苦恼于如何到更高的楼层，现在我终于可以上去了。 我听说银盾在11楼，银剑在17楼，这消息不知道对你是否有用。","    我们终于逃出来了。你的剑和盾被警卫拿走了，你必须先找到武器。我知道铁剑在5楼，铁盾在9楼，你最好先取到它们。我现在有事要做没法帮你，再见。","    你清醒了吗？你到监狱时还处在昏迷中，魔法警卫把你扔到我这个房间。但你很幸运，我刚完成逃跑的暗道你就醒了，我们一起越狱吧。","    ------ 喂！醒醒！","    ------ 喂！","    ------","    什么？","    魔王 Zeno 说：\u201c欢迎来到魔塔，你是第一百位挑战者。你若能打败我所有的手下，我就与你一对一的决斗。现在你必须接受我的安排。","Exchange_array","Messa
